// CGI DATATYPES

// Vector_2i is vector of any two integers 
    typedef struct v2i_proto
    {
        i32 x, y;
    } v2i;

    // helper function for Vector_2i
    v2i make_vector2i(i32 x, i32 y)
    {
        v2i result = {x, y};
        return result;
    }

// Rectangle type
    typedef struct rect_proto
    {
        i32 left, top, right, bottom;
    } rect_i32;

    // helper function for rect_i32
    rect_i32 make_rect_i32(i32 left, i32 top, i32 right, i32 bottom)
    {
        rect_i32 result = {left, top, right, bottom};
        return result;
    }

// Sprite type
    typedef struct spr_proto
    {
        v2i size;
        u32 *ptr_data;
    } sprite;

    // helper function for sprite
    sprite make_sprite(v2i sprite_size, u32 *sprite_data)
    {
        sprite result;
        result.size.x   = sprite_size.x;
        result.size.y   = sprite_size.y;
        result.ptr_data = sprite_data;

        return result;
    }

