// CGI FUNCTION

// plot_pixel
void plot_pixel(v2i pixel_pos, u32 pixel_color, struct img_proto *img)
{
    //
    u32 *ptr_pixel = (u32 *)img->ptr_raster_data;
    
    // bounds
    if  (
            pixel_pos.x >= 0 && pixel_pos.x < img->img_width
            &&
            pixel_pos.y >= 0 && pixel_pos.y < img->img_height
        )
    
    {
        ptr_pixel[pixel_pos.y * img->img_width + pixel_pos.x] = pixel_color;
    }

}

// read pixel at location
u32 read_pixel(v2i pixel_pos, struct img_proto *img)
{
    //
    u32 *ptr_pixel = (u32 *)img->ptr_raster_data;

    //
    u32 pixel_color = 0;

    // bounds
    if  (
            pixel_pos.x >= 0 && pixel_pos.x < img->img_width
            &&
            pixel_pos.y >= 0 && pixel_pos.y < img->img_height
        )

        {

            pixel_color = ptr_pixel[pixel_pos.y * img->img_width + pixel_pos.x];
        }   

        return pixel_color;
}

// plot_rect_i32
void plot_rect_i32(rect_i32 rect, u32 rect_color, struct img_proto *img)
{
    //
    u32 *ptr_rect = (u32 *)img->ptr_raster_data;

    // bound to buffer size
    if ( rect.left   < 0 )                  { rect.left   = 0; }
    if ( rect.top    < 0 )                  { rect.top    = 0; }
    if ( rect.right  > img->img_width  )    { rect.right  = img->img_width;  }
    if ( rect.bottom > img->img_height )    { rect.bottom = img->img_height; }

    // fwd to rect start
    ptr_rect += rect.top * img->img_width + rect.left;

    for (i32 y = 0; y < rect.bottom; ++y)
    {
        // fill line
        for (i32 x = 0; x < rect.right; x++) { *ptr_rect++ = rect_color; }

        // next line of rect
        ptr_rect += img->img_width - rect.right;
    }

}

// plot_sprite
void plot_sprite(v2i sprite_pos, sprite *spr, struct img_proto *img)
{
    // bound sprite_pos
    if (sprite_pos.x < 0 )  { sprite_pos.x = 0; }
    if (sprite_pos.y < 0 )  { sprite_pos.y = 0; }

    // maybe bound to { img_width - sprite_size } 
    if (sprite_pos.x > img->img_width  )  { sprite_pos.x = img->img_width  / 2; }
    if (sprite_pos.y > img->img_height )  { sprite_pos.y = img->img_height / 2; }
    
    // 
    u32 color_sprite = 0;

    //
    for (i32 y = 0; y < spr->size.y; ++y)
    {
        for (i32 x = 0; x < spr->size.x; ++x)
        {
            // check transparent
            if (spr->ptr_data[y * spr->size.x + x] != 0)
            {
                color_sprite = spr->ptr_data[y * spr->size.x + x];
                plot_pixel(make_vector2i(sprite_pos.x + x, sprite_pos.y + y), color_sprite, img);
            }
        }

    }

}

